{"4": ["Тоже прислали не тот аппарат, на мощность 12 Вт.- питание не от сети. Невнимательность сотрудников магазина- за это и одна звезда. Аппарат, кстати, тоже довольно хлипенький и не внушает доверия. Болт один открученный в коробке болтается. Может в работе он «молодец», но выяснить это не удалось. Возврат. ", "2020-10-24T21:15:08Z", "", "0", 2, 0, 1, "Ультразвуковой отпугиватель от грызунов (крыс и мышей), Тайфун ЛС-800, 220В", "Тайфун (Алекс)"], "5": ["Заказывал с питанием 220 в. Прислали на 12 в. Полное несоответствие с описанием товара.", "2020-10-20T13:14:19Z", "", "0", 2, 0, 1, "Ультразвуковой отпугиватель от грызунов (крыс и мышей), Тайфун ЛС-800, 220В", "Тайфун (Алекс)"], "6": ["Вообще не поняла, что привезли. К сожалению, коробку открыла только сегодня. Где вилка для розетки? Где выключатель? Где ручка? Почему провод замотан изолентой? Полное несоответствие. Не ожидала такой подставы.", "2020-10-18T09:44:13Z", "", "0", 2, 0, 1, "Ультразвуковой отпугиватель от грызунов (крыс и мышей), Тайфун ЛС-800, 220В", "Тайфун (Алекс)"]}
